import React from 'react'
import { StyleSheet, View, Text } from 'react-native'

function Settings() {
  return (
    <View style={styles.container}>
       <Text style={styles.nom} >Salle n°5</Text>
       <Text style={styles.capacite} >Capacité : peut recevoir jusqu'à 41 personnes</Text>
       <Text style={styles.materiel} >Matériel associé : projecteur </Text>
       <Text style={styles.disponibilite} >Disponibilité : encore disponible</Text>
    </View>
  )
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    backgroundColor: '#ebebeb'
  },
  nom: {
    color: 'white'
  },
  capacite: {
    color: 'white'
  },
  materiel: {
    color: 'white'
  },
  disponibilite: {
    color: 'white'
  },
})

export default Settings
